import React, { useEffect, useRef } from "react";
import axios from "axios";

export default function LinkedInCallback() {
  const is_loaded = useRef(false);

  const getAuthCode = async () => {
    try {
      const token = window.location.href.split("?")[1].split("=")[1];
      const response = await axios.get(
        `http://localhost:8000/getAccessToken?token=${token}`
      );
    } catch (e) {
      console.log(e);
    }

    // return response;
  };

  useEffect(() => {
    if (is_loaded.current) return;
    console.log("running use effect here");
    getAuthCode();
    is_loaded.current = true;
  }, []);

  return <div>LinkedInCallback</div>;
}
